import { Spinner } from '@chakra-ui/react';
import React from 'react';
import {
	InteractiveForceGraph,
	ForceGraphNode,
	ForceGraphLink,
} from 'react-vis-force';
// data structure definitions for NodeGraph component
interface links {
	source: string;
	target: string;
}
interface nodes {
	id: string;
}
interface nodeGraphDataStruct {
	nodes: nodes[];
	links: links[];
}

function SocialNodeGraph({
	nodeGraphData,
}: {
	nodeGraphData: nodeGraphDataStruct;
    }) {

        return (
					<>
						{nodeGraphData.nodes.length == 0 ? (
							<Spinner />
						) : (<InteractiveForceGraph
  simulationOptions={{ height: 300, width: 300 }}
  labelAttr="label"
  onSelectNode={(node) => console.log(node)}
  highlightDependencies
></InteractiveForceGraph>,
							nodeGraphData.nodes.map((node) => (
								<ForceGraphNode key={node.id} node={{ id: node.id, label: node.id }} fill="blue" />
                            )),
                        nodeGraphData.links.map((link) => (
                                 <ForceGraphLink key={link.source+link.target} link={{ source: link.source, target: link.target }} />
                            ))
						)}
					</>
				);

}
export default SocialNodeGraph;
